import { LightningElement, wire, api } from 'lwc';
import getAccountDetails from '@salesforce/apex/GetAccounts.getAccountDetails';
import getContactSegmentStatus from '@salesforce/apex/GetCustomersFromSegment.getContactSegmentStatus';


export default class PersonAccountCard extends LightningElement {
    @api recordId;
    message = '';
    accountId = '';
    

    @wire(getAccountDetails, { accountId: '$recordId' })
    account;

    @wire(getContactSegmentStatus, { id: '$personContactId' })
    wiredSegment({ data, error }) {
        console.log('Record Id is:',this.recordId);
        console.log('Inside segment wire method');
        console.log('Received data:', data);
        if (data) {
            console.log('Data received from Apex:', data);
            this.accountId = data;
            this.setMessage();
        } else if (error) {
            console.error('Error:', error);
        }
    }
    

    setMessage() {
        console.log('Setting message based on accountId:', this.accountId);
        if (this.accountId) {
            this.message = 'Customer has recall product';
        } else {
            this.message = 'Customer doesnt have recall product';
        }
        console.log('Message is now:', this.message);
    }
    
    get hasData() {
        return this.account?.data !== undefined;
    }
    
    get error() {
            return this.account?.error;
        }

    get personContactId(){
        return this.account?.data?.PersonContactId;
       }

    get name() {
            return this.account?.data?.Name;
        }
    
    get customerId() {
            return this.account?.data?.Membership_Number__pc;
        }
    
    get shippingCity() {
            return this.account?.data?.ShippingCity;
        }
    
    get shippingState() {
            return this.account?.data?.ShippingState;
        }
    
    get shippingPostalCode() {
            return this.account?.data?.ShippingPostalCode;
        }
    
    get shippingStreet() {
            return this.account?.data?.ShippingStreet;
        }

   /* get lifetimeValue() {
            const value = this.account?.data?.Contacts[0]?.LifetimeValue__c;
            return Math.round(value * 100) / 100;

        }*/
    
    get lifetimeValue() {
            const value = this.account?.data?.Contacts?.[0]?.LifetimeValue__c;
            return (value || value === 0) ? (Math.round(value * 100) / 100) : '';
        }

    get propensityToPurchase() {
            const value = this.account?.data?.Contacts?.[0]?.Propensity_to_purchase__c;
            return (value || value === 0) ? (Math.round(value * 100) / 100) : '';
        }

    get engagementScore(){
            return (((this.account?.data?.Contacts?.[0]?.EngagementScore__c ?? 0) / 15) * 100).toFixed(2) + '%';
        }
    
        
   /* get propensityToPurchase() {
            return this.account?.data?.Contacts[0]?.Propensity_to_purchase__c;
        }*/

    
    get photoURL() {
            const photoURL = this.account?.data?.PhotoURL__c;
            const name = this.account?.data?.Name;

                    if (photoURL) {
                        return photoURL;
                    } else {
                         if (name === 'Mark Smith') {
                               return 'data:image/png;base64,';
                            }else if(name === 'Abigail Green'){
                                return 'data:image/png;base64,';
                            }
                             else {
                                return 'https://res.cloudinary.com/btahub/image/upload/v1708357811/ntbg5p1mwixury672dxy.png';
                            }
                    }
    }       
}